import React from "react";
import "./style.css";

function Navbar(props) {
    return (
        <nav className="navbar navbar-dark bg-dark transparent" id="nav1">
            <div className="navDiv">
                <a className="navbar-brand" href="/">React Portfolio</a>
                <a className="navMenu"> About</a>
                <a className="navMenu">Portfolio</a>
                <a className="navMenu">Contact</a>
            </div>
        </nav>
    );
}

export default Navbar;
